body {
  position: absolute;
  width: 100%;
  height: 100%;
  margin: 0;
}

#black_score_div {
  position: absolute;
  left: 5%;
}

#white_score_div {
  position: absolute;
  right: 5%;
}

#outer_div {
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
}

#othello_board {
  position: absolute;
  flex-grow: 1;
  display: grid;
  grid-template-columns: 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr;
  margin: 0 auto;
}

#othello_board > div {
  display: grid;
  grid-template-rows: 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr;
  width: 80px;
  height: 640px;
}

#othello_board > div > div {
  border-style: solid;
  border-width: thin;
  background: green;
}

#othello_board > div > div:hover {
  background: red;
}

#othello_board > div > div > div {
  visibility: hidden;
  position: relative;
  left: 10%;
  top: 10%;
  width: 60px;
  height: 60px;
  border-radius: 100%;
}
